import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Navbar from './components/Navbar';
import Home from './pages/Home';
import TopicModeling from './pages/TopicModeling';
import RiskIdentification from './pages/RiskIdentification';
import RiskQuantification from './pages/RiskQuantification';
import Reports from './pages/Reports';
import About from './pages/About';
import Contact from './pages/Contact';
import Footer from './components/Footer';

const theme = createTheme({
  palette: {
    primary: {
      main: '#2980B9',
      light: '#3498DB',
      dark: '#1F618D',
    },
    secondary: {
      main: '#34495E',
      light: '#2C3E50',
      dark: '#2C3E50',
    },
    background: {
      default: '#F2F2F2',
      paper: '#FFFFFF',
    },
  },
  typography: {
    fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
    h1: {
      fontWeight: 700,
    },
    h2: {
      fontWeight: 600,
    },
    h3: {
      fontWeight: 600,
    },
  },
  components: {
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 8,
          textTransform: 'none',
          fontWeight: 600,
        },
      },
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Router>
        <div className="App">
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/topic-modeling" element={<TopicModeling />} />
            <Route path="/risk-identification" element={<RiskIdentification />} />
            <Route path="/risk-quantification" element={<RiskQuantification />} />
            <Route path="/reports" element={<Reports />} />
            <Route path="/about" element={<About />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
          <Footer />
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
